    s2_32 = -2.0*q2_x**2 - 2.0*q2_y**2 + 1.0
    s2_33 = 1.0*(2*q2_x*q2_z + 2*q2_y*sqrt(-q2_x**2 - q2_y**2 - q2_z**2 + 1))*cos(t*w_0) + 1.0*(-2*q2_x*sqrt(-q2_x**2 - q2_y**2 - q2_z**2 + 1) + 2*q2_y*q2_z)*sin(t*w_0)



    
